  "text" : "\uC0C1\uCC98\uB97C \uC785\uC5B4\uAC00\uBA70 \uAE38\uB0E5\uC774\uB4E4\uC744 \uD3EC\uD68D\uD558\uACE0, \uC790\uBE44\uB85C \uC911\uC131\uD654\uB97C \uC2DC\uCF1C \uBD84\uC591\uC744 \uD574\uB3C4 1\uCC28\uC801\uC73C\uB85C\uB294 \uC601\uBB18\uB098 \uBBF8\uBB18\uAC00 \uC544\uB2CC \uC774\uC0C1\uC740 \uBD84\uC591\uC774 \uC815\uB9D0 \uD798\uB4E0 \uD3B8\uC774\uACE0, \uC5B4\uB5BB\uAC8C \uC5B4\uB5BB\uAC8C \uACA8\uC6B0 \uBD84\uC591\uC5D0 \uC131\uACF5\uD558\uB354\uB77C\uB3C4 \uB098\uC911\uC5D0 \uBCC0\uC2EC\uD558\uC5EC \uBC18\uD658\uD558\uB824 \uD558\uAC70\uB098 \uBC84\uB9AC\uB294 \uC0AC\uB78C\uB4E4\uC774 \uB9CE\uB354\uB77C\uACE0\u2026 \uADF8 \uB54C \uBD80\uB4E4\uBD80\uB4E4",
