  "text" : "\uC5EC\uD2BC\u2026 \uC774\uC6C3\uB4E4\uC758 '\uD604\uC874\uD558\uB294 \uD53C\uD574' \uB54C\uBB38\uC5D0 \uAE38\uB0E5\uC774 \uAE09\uC2DD\uC744 \uD3EC\uAE30\uD558\uACE0 \uC120\uD0DD\uD55C \uBC29\uBC95\uC774 '\uAE38\uB0E5\uC774\uB4E4\uC744 \uB370\uB824\uB2E4\uAC00 \uB0B4\uAC00 \uC9C1\uC811 \uCC45\uC784\uC9C0\uACE0 \uD0A4\uC6B0\uAC70\uB098 \uC785\uC591\uC744 \uBCF4\uB0B4\uC790' \uC600\uB294\uB370, \uADF8 \uACFC\uC815\uC5D0\uC11C \uC5BB\uC740 \uB9C8\uC74C\uC758 \uC0C1\uCC98\uAC00 \uB108\uBB34 \uCEE4\uC11C, \uADF8 \uD2B8\uB77C\uC6B0\uB9C8\uB85C \uC778\uD574 \uACE0\uC591\uC774\uB97C \uD0A4\uC6B0\uC9C0 \uBABB\uD558\uAC8C \uB418\uC5B4\uBC84\uB9BC\u2026",
