  "text" : "3\uCE35\uC5D0 \uAC70\uC8FC\uC911\uC778 \uC800\uB3C4 \uADF8\uB7F0\uB370, 2\uCE35(1\uCE35\uC740 \uC8FC\uCC28\uC7A5\uACFC \uAD00\uB9AC\uC2E4)\uC740 \uC624\uC8FD\uD558\uACA0\uC5B4\uC694. \uACE0\uC591\uC774 \uC0AC\uB8CC \uBD80\uC2A4\uB7EC\uAE30\uC5D0 \uBAB0\uB824\uB4E0 \uAC1C\uBBF8\uB5BC\uC5D0 \uC774\uBBF8 \uC810\uB839\uB2F9\uD588\uB2E4\uACE0\u2026 \uC2EC\uC9C0\uC5B4 2\uCE35\uC758 \uD55C \uC9D1\uC5D0\uC11C\uB294 \uC544\uC774\uB97C \uD0A4\uC6B0\uACE0 \uC788\uB294\uB370, \uAC1C\uBBF8\uAC00 \uBD84\uC720\uD1B5\uAE4C\uC9C0 \uB36E\uCCE4\uB2E4\uACE0 \uD569\uB2C8\uB2E4.\n\n\uB355\uBD84\uC5D0 \uC8FC\uB9D0\uC5D0 \uBC29power\uC5ED",
