  "text" : "\uC694\uC998 \uC77C\uACFC \uC911 \uD558\uB098\uAC00, \uC9D1 \uC548\uC5D0 \uB3CC\uC544\uB2E4\uB2C8\uB294 3mm \uC815\uB3C4\uC758 \uAC1C\uBBF8\uB4E4\uC744 \uB208\uC5D0 \uB744\uB294 \uC871\uC871 \uD734\uC9C0\uB85C \uB20C\uB7EC \uC8FD\uC774\uB294 \uAC83. 10\uBD84 \uC815\uB3C4\uB9CC \uD22C\uC790\uD558\uBA74 \uD07C\uC9C0\uB9C9\uD55C \uAC1C\uBBF8\uB5BC \uC218\uC2ED \uB9C8\uB9AC\uB97C \uB20C\uB7EC \uC8FD\uC77C \uC218 \uC788\uC73C\uB098, \uD610\uC624\uBB3C\uC740 \uD328\uC2A4..\n\n\uADF8 \uADFC\uC6D0\uC744 \uB530\uB77C\uAC00\uBCF4\uBA74 \uAC1C\uD310\uC73C\uB85C \uD574\uB193\uC740 \uB0E5\uC774 \uAE09\uC2DD\u2026",
