  "text" : "\uAE30\uD0C0 \uD3ED\uB825\uBC94\uC8C4\uC5D0 \uB300\uD558\uC5EC\uB294 \uBC29\uC704\uD589\uC704\uB97C \uD589\uD558\uC5EC \uBD88\uBC95\uCE68\uD574\uC790\uC758 \uC0AC\uC0C1\uC744 \uCD08\uB798\uD55C \uACBD\uC6B0\uB77C\uB3C4 \uACFC\uC789\uBC29\uC704\uC5D0 \uC18D\uD558\uC9C0 \uC54A\uC73C\uBA70 \uD615\uC0AC\uCC45\uC784\uC744 \uC9C0\uC9C0 \uC544\uB2C8\uD55C\uB2E4.\"\n\n\uC989, \uD749\uD3EC\uD558\uACE0 \uC778\uC2E0\uC758 \uC548\uC804\uC744 \uC911\uB300\uD558\uAC8C \uC704\uD611\uD558\uB294 \uAC15\uAC04 \uB4F1 \uBC94\uC8C4\uAC00 \uC544\uB2C8\uC600\uAE30\uC5D0 \uBB34\uD55C\uBC29\uC704\uAD8C\uC758 \uC801\uC6A9\uC744 \uBC1B\uC744 \uC218 \uC5C6\uC5C8\uB358 \uAC83 \uAC19\uC74C",
