  "text" : "\"\u5BF9\u6B63\u5728\u8FDB\u884C\u884C\u51F6\u3001\u6740\u4EBA\u3001\u62A2\u52AB\u3001\u5F3A\u5978\u3001\u7ED1\u67B6\u4EE5\u53CA\u5176\u4ED6\u4E25\u91CD\u5371\u53CA\u4EBA\u8EAB\u5B89\u5168\u7684\u66B4\u529B\u72AF\u7F6A,\u91C7\u53D6\u9632\u536B\u884C\u4E3A,\u9020\u6210\u4E0D\u6CD5\u4FB5\u5BB3\u4EBA\u4F24\u4EA1\u7684,\u4E0D\u5C5E\u4E8E\u9632\u536B\u8FC7\u5F53,\u4E0D\u8D1F\u5211\u4E8B\u8D23\u4EFB.\"\n\n\uC774 \uC870\uBB38\uC758 \uD574\uC11D\uC740 \"\uD604\uC7AC \uC9C4\uD589 \uC911\uC778 \uD749\uD3EC\uD55C \uD589\uC704, \uC0B4\uC778, \uAC15\uB3C4, \uAC15\uAC04, \uB0A9\uCE58 \uBC0F \uAE30\uD0C0 \uC778\uC2E0\uC758 \uC548\uC804\uC744 \uC911\uB300\uD558\uAC8C \uC704\uD611\uD558\uB294",
