  "text" : "\uAD6D\uAC00\uAC00 \uBC18\uB4DC\uC2DC \uAD6C\uD558\uB7EC \uC62C \uAC83\uC774\uB77C\uB294 \uBBFF\uC74C\uC774 \uC5C6\uACE0, \uADF8\uB807\uAC8C \uBBFF\uACE0 \uC591\uBCF4\uD558\uB358 \uC0AC\uB78C\uB4E4\uC774 \uC5B4\uB5A0\uD55C \uACB0\uACFC\uB97C \uB9DE\uC774\uD588\uB294\uC9C0\uC5D0 \uB300\uD55C \uC778\uC2DD\uB9CC \uC788\uB2E4\uBCF4\uB2C8, \uC120\uC7A5\uACFC \uC120\uC6D0\uB4E4\uC774 \uB05D\uAE4C\uC9C0 \uB0A8\uC544 \uC2B9\uAC1D\uC744 \uD0C8\uCD9C\uC2DC\uD0A4\uAE30\uB294 \uCEE4\uB155, \uAC00\uC7A5 \uBA3C\uC800 \uD0C8\uCD9C\uD558\uB824\uACE0 \uAE30\uB97C \uC4F0\uB294 \uAE30\uB9C9\uD78C \uC0C1\uD669\uC774 \uC624\uC9C0 \uC54A\uC558\uB098 \uC2F6\uC74C..",
