  "id_str" : "484354465114230785",
  "text" : "\uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC774 \uC544\uB2C8\uB77C\uACE0 \uD574\uB3C4 \"\uC5B4\uC774\uAD6C \uC798\uB098\uC168\uC5B4\uC694. \uBA4D\uCCAD\uD55C \uC800\uB294 \uACC4\uC18D \uC774\uB807\uAC8C \uC0DD\uAC01\uD560\uB78D\uB2C8\uB2E4\"\uB77C\uB294 \uC0AC\uB78C\uB4E4 \uC190\uC5D0 \uD615\uBC95\uCD1D\uCE59\uC774\uB098 \uD5CC\uBC95 \uAE30\uBCF8\uC11C\uB97C \uC950\uC5B4\uC900\uB2E4\uACE0 \uD574\uACB0\uB420 \uB9C8\uC778\uB4DC\uB3C4 \uC544\uB2C8\uACE0, \uADF8\uB807\uAC8C \uC811\uADFC\uD558\uBA74 \uC548\uB41C\uB2E4\uACE0 \uC54C\uB824\uC918\uB3C4 \uC124\uB4DD\uC744 \uD560 \uC218 \uC788\uC744 \uAC83 \uAC19\uC9C0\uB3C4 \uC54A\uC73C\uB2C8 \uADF8\uB0E5 \uB178\uAD00\uC2EC",
