  "text" : "\uACB0\uCF54 \uB0A8\uC774 \uD3B8\uACAC\uC744 \uBC84\uB9AC\uB3C4\uB85D \uC124\uB4DD\uD558\uB824 \uD558\uC9C0 \uB9C8\uB77C. \uC0AC\uB78C\uC774 \uC124\uB4DD\uC73C\uB85C \uD3B8\uACAC\uC744 \uAC16\uAC8C \uB41C \uAC83\uC774 \uC544\uB2C8\uB4EF\uC774, \uC124\uB4DD\uC73C\uB85C \uBC84\uB9B4 \uC218 \uC5C6\uB2E4.\n\n- \uC2DC\uB4DC\uB2C8 \uC2A4\uBBF8\uC2A4",
