  "text" : "\uB300\uBD80\uBD84\uC758 \uBC94\uBC95\uD589\uC704\uB294 '\uB0B4 \uD589\uC704\uAC00 \uC801\uBC1C\uB418\uC9C0 \uC54A\uC744 \uAC83\uC774\uB2E4' \uB77C\uB294 \uBBFF\uC74C\uC5D0\uC11C \uBE44\uB86F\uB41C\uB2E4\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uC544\uBB34\uB9AC \uC0AC\uC18C\uD55C \uD589\uC704\uB77C\uB3C4, \uC790\uC2E0\uC758 \uBC94\uBC95\uD589\uC704\uAC00 \uBC18\uB4DC\uC2DC \uC801\uBC1C\uB418\uC5B4 \uB313\uAC00\uB97C \uCE58\uB8E8\uAC8C \uB41C\uB2E4\uB294 \uC778\uC2DD\uC774 \uD37C\uC9C4\uB2E4\uBA74 \uBC94\uC8C4\uC728\uC774 \uC904\uC5B4\uB4E4 \uAC83\uC744 \uAE30\uB300\uD574 \uBCFC \uC218 \uC788\uACA0\uC8E0. \uADF8\uAC8C \uBC14\uB85C \uC608\uBC29.",
