  "text" : "\uB0A8\uB4E4 \uC55E\uC5D0\uC11C\uB294 \uC5C4\uACA9\uD55C \uCC98\uBC8C\uACFC \uD615\uB7C9 \uAC15\uD654\uB97C \uC8FC\uC7A5\uD558\uACE0, \uD0C0\uC778\uC758 \uC548\uC804\uBD88\uAC10\uC99D\uC744 \uC131\uD1A0\uD558\uB358 \uC0AC\uB78C\uB4E4\uB3C4 \uB9C9\uC0C1 \uB3C4\uB85C\uC5D0 \uB098\uAC00\uBA74 \uB09C\uD3ED\uC6B4\uC804\uC5D0 \uBD88\uBC95\uC8FC\uC815\uCC28, \uC74C\uC8FC\uC6B4\uC804\uC744 \uD558\uACE0, \uC544\uBB34\uB370\uB098 \uC4F0\uB808\uAE30\uB97C \uBC84\uB9AC\uACE0, \uADF8\uB4E4\uC758 \uC544\uC774\uB4E4 \uC5ED\uC2DC \uC774\uB7EC\uD55C \uBAA8\uC2B5\uB4E4\uC744 \uBCF4\uACE0 \uC790\uB77C\uB098\uB294\uB370 \uBB34\uC2A8 \uBBF8\uB798\uAC00 \uC788\uACA0\uB098..",
